import "./Homepage.css";
import Header from "../../header/Header";
import Sidebar from "../../sidebar/sidebar";
import Posts from "../../posts/post";
const HomePage = () => {
  return (
    <>
      <Header></Header>
      <div className="home">
        <Sidebar></Sidebar>
        <Posts></Posts>
      </div>
    </>
  );
};

export default HomePage;
